import React from "react";
import {
  FooterContainer,
  FooterSubscription,
  FooterSubHeading,
  FooterSubText,
} from "./FooterElements";

const Footer = () => {
  return <FooterLinksContainer>
    <FooterLinksWrapper>
      <FooterLinksItems>
        <FooterLink to='/faq'>FAQ</FooterLink>
      </FooterLinksItems>
    </FooterLinksWrapper>
  </FooterLinksContainer>;
};

export default Footer;
